INSERT INTO faqs VALUES("2","2","Active","1","How to signup as a user?","First of all download the NinjaOnCall&nbsp;user application from the Appstore. After installing go to signup page and fillup required details.","Front","Paano mag-signup bilang isang user?","Una sa lahat i-download ang application ng user ng NinjaOnCall mula sa Appstore. Pagkatapos mag-install pumunta sa pahina ng pag-signup at kinakailangang detalye ng fillup.");
INSERT INTO faqs VALUES("3","3","Active","2","How it works?","Login to the NinjaOnCall application and select appropriate car/service type.INSERT INTO faqs VALUES("62","2","Active","3","Why do we use it?","It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout.","Front","Bakit ginagamit namin ito?","Ito ay isang matagal na itinatag na katotohanan na ang isang mambabasa ay ginulo ng nababasa nilalaman ng isang pahina kapag tumitingin sa layout nito.");
INSERT INTO faqs VALUES("63","1","Active","5","Where can I get some?","There are many variations of users of Lorem Ipsum available, but the majority have suffered alteration in some form, by injected humour, or randomised words which don\'t look even slightly believable.","Front","Saan ako makakakuha ng ilan?","Mayroong maraming mga pagkakaiba-iba ng mga gumagamit ng Lorem Ipsum na magagamit, ngunit ang karamihan ay nagdusa pagbabago sa ilang mga form, sa pamamagitan ng injected katatawanan, o randomized salita na hindi tumingin kahit na bahagyang malamang.");
INSERT INTO faqs VALUES("64","3","Active","4","Where does it come from?","It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old.Contrary to popular belief, Lorem Ipsum is not simply random text.","Front","Saan nagmula ito?","Ito ay may mga pinagmulan sa isang piraso ng klasikal na literaturang Latin mula 45 BC, na ginawang higit sa 2000 taong gulang. Hiwalay sa popular na paniniwala, ang Lorem Ipsum ay hindi lamang simpleng teksto.");
INSERT INTO faqs VALUES("66","3","Active","6","Did you provide Wifi?","Lorem Ipsum is simply dummy text of the printing and INSERT INTO faqs VALUES("69","1","Active","7","What is Lorem Ipsum?","Lorem Ipsum&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.","Front","Ano ang Lorem Ipsum?","Ang Lorem Ipsum ay simpleng teksto ng industriya ng pag-print at pag-type. Si Lorem Ipsum ay isang standard na dummy text sa industriya mula pa noong 1500s, nang kumuha ng isang hindi kilalang printer ang isang uri ng bangkang de kusina at pinirituhan ito upang makagawa ng isang uri ng libro ng ispesimen.");
INSERT INTO help_detail VALUES("1","3","Active","4","Vehicle was different","You can see the driver vehicle details in the app once the driver accept your request for ride. The vehicle details are provided to recognize him/her easily. If driver arrived in different vehicle then please provide some additional info here.","Front","Ang sasakyan ay iba","Maaari mong makita ang mga detalye ng sasakyan sa pagmamaneho sa app sa sandaling tinanggap ng driver ang iyong kahilingan para sa pagsakay. Ang mga detalye ng sasakyan ay ibinigay upang makilala siya nang madali. Kung dumating ang driver sa iba\'t ibang sasakyan pagkatapos ay mangyaring magbigay ng ilang karagdagang impormasyon dito.","No");
INSERT INTO help_detail VALUES("2","2","Active","3","Driver drove dangerously","During trip if you feel that your driver drove dangerously or was unsafe then please let us know here.","Front","Nagmaneho ang driver","Sa panahon ng paglalakbay kung sa palagay mo ang iyong driver ay nagdulot ng dangerously o hindi ligtas pagkatapos mangyaring ipaalam sa amin dito.","No");
INSERT INTO help_detail VALUES("3","1","Active","2","Contact driver about a lost item","Kung naiwan mo ang item sa isang sasakyan pagkatapos ay mangyaring makipag-ugnay sa driver kung mayroon ka nang kanyang numero. Mangyaring maabot sa amin sa kaso kung wala kang driver contact.","Front","Makipag-ugnay sa driver tungkol sa isang nawalang item","Kung naiwan mo ang item sa isang sasakyan pagkatapos ay mangyaring makipag-ugnay sa driver kung mayroon ka nang kanyang numero. Mangyaring maabot sa amin sa kaso kung wala kang driver contact.","No");
INSERT INTO help_detail VALUES("4","3","Active","1","Vehicle was not in good condition","Drivers have to maintain their cars well.&nbsp; If driver arrived in vehicle which is in poor condition then please provide some additional info here.","Front","Ang sasakyan ay wala sa mabuting kalagayan","Dapat panatilihin ng mga driver ang kanilang mga kotse. Kung dumating ang driver sa sasakyan na wala sa kondisyon, mangyaring magbigay ng karagdagang impormasyon dito.","No");
