INSERT INTO home_content VALUES("1","EN","That One Service That You Want","Taxi, Delivery, Or Other Services On Demand Just For You","banner-img_EN_EN.png","Driver Or company? The text to display in homepage after user login.","home-img_EN.jpg","The text to display in homepage after user login.","Tap, Ride, Tap â That is all there is to it","<p>The smart way of travelling, all with your smart phone and three little taps. Tap and look for your ride, Tap and book your ride and Tap and complete your ride. Your tap brings the driver to you for the best riding experience of your life, each one better than the previous one.</p>INSERT INTO home_content VALUES("41","TL","Iyon Isang Serbisyo na Gusto Ninyo","Taxi, Paghahatid, O Iba Pang Mga Serbisyo Sa Demand Just For You","banner-img_EN_TL.png","Driver O kumpanya? Ang teksto na ipapakita sa homepage pagkatapos mag-login ng user.","home-img_ufx_TL.jpg","Ang teksto na ipapakita sa homepage pagkatapos mag-login ng user.","Tapikin, Pagsakay, Tapikin - Iyan ang lahat doon dito","<p>Ang smart paraan ng paglalakbay, ang lahat sa iyong smart phone at tatlong maliit na taps. Tapikin at hanapin ang iyong pagsakay, Tapikin at i-book ang iyong pagsakay at Tapikin at kumpletuhin ang iyong biyahe. Dinadala ng iyong tap ang driver sa iyo para sa pinakamahusay na karanasan sa pagsakay sa iyong buhay, bawat isa ay mas mahusay kaysa sa nakaraang isa.</p>INSERT INTO home_driver VALUES("1","promotions-img5_20180524045945.jpg","Lorem Ipsum content","Lorem Ipsum content","Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\\\'s standard dummy text ever since the 1500s,<br>when an unknown printer took a galley of type and scrambled it to make a type.","Lorem Ipsum content","Lorem Ipsum content","Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\\\'s standard dummy text ever since the 1500s,<br>when an unknown printer took a gall