INSERT INTO pages VALUES("1","About Us","","","","About Us","About Us","About Us","About Us","<p>Ninjaoncall is a neighborhood focused on-demand service provider that allows consumers to use the convenience of their mobile phones to schedule and request a range of ready services.&nbsp; Current service offerings include: home delivery, carwash, roadside assistance, and on demand taxi service.</p>","Active","About Us","<p>Ang Ninjaoncall ay isang lugar na nakatutok sa on-demand service provider na nagpapahintulot sa mga mamimili na gamitin ang kaginhawahan ng kanilang mga mobile phone upang mag-iskedyul at humiling ng isang hanay ng mga handa na serbisyo. Kasama sa kasalukuyang mga alay sa serbisyo ang: paghahatid ng tahanan, carwash, tulong sa tabing-daan, at serbisyo sa taxi.</p>");
