DROP TABLE coupon;

CREATE TABLE `coupon` (
  `iCouponId` int(12) NOT NULL AUTO_INCREMENT,
  `vCouponCode` varchar(50) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `tDescription` text CHARACTER SET utf8 NOT NULL,
