\n\n<p>No hassles of direction giving as your driver know exactly where you want to go. Payment completed via your credit card. Just sit back and enjoy your ride!</p>","box1_img_EN.jpg","Ever Ready, Anytime, Anywhere, Everyday","<p>Wherever you want to go, irrespective of time, date and place, we are always ready. No waiting charges, no reservations, just our professionalism and courteous service.</p>\n\n<p>At your service 24/7, we take pride in what we do and it reflects in our driving. Building a relationship with clients that goes beyond professionalism.</p>","1_EN_EN.jpg","Quick, Efficient & Secure","<p>When you need your load to reach from Point A to B, quickly and securely, then you can rely on Drop and Run. We take confidentiality very seriously.</p>","3-ufx_EN.jpg","Guaranteed Service With A Smile For All Your Jobs","<p>All our professionals take pride in their work and will ensure that they give you their very best, leaving you satisfied. We guarantee that you will use our services again and again with the confidence that we deliver what we say &ndash; the best! Just tap the app and leave the rest to us while you sit back and relax.</p>","mobile-app-bg_EN.jpg","mobile-img-del-ufx_EN.png","THAT PERFECTLY SYNCHRONISED RIDE JUST FOR YOU","<p>Tap the app, select a driver, get to your destination without looking back. That is what our app will do. No words are necessary when you ride with us because we know exactly what you want. Ride and save with us &ndash; luxury cannot get any cheaper.</p>\n\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>","taxi-app-img-bg_EN.jpg","taxi-app-img-ride_EN.jpg","A PERSONAL RIDE AT ALL TIMES","<p>We are more than just a taxi system &ndash; a service that is at your beck and call at all times of the day or night, wherever you are in the world, professional services with a smile&nbsp; and no embarrassment during payment time &ndash; we give you the best ride whilst looking after your comfort and convenience</p>\n\n<p><span><a href=\"about-us\"><em>MORE INFO</em></a></span></p>","Meet Our Providers","Our driving family welcomes you on board with a smile. Just look out for them!","Active");
\n\n<p>Walang abala ng pagbibigay ng direksyon kung paano alam ng iyong driver kung saan mo gustong pumunta. Ang bayad na nakumpleto sa pamamagitan ng iyong credit card. Pumupunta lang at tamasahin ang iyong biyahe!</p>","box1_img_TL.jpg","Kailanman Handa, Anumang Oras, Saanman, Araw-araw","<p>Hangga&#39;t nais mong pumunta, hindi isinasaalang-alang ang oras, petsa at lugar, lagi kaming handa. Walang mga singil sa paghihintay, walang reservation, lamang ang aming propesyonalismo at magalang na serbisyo.</p>\n\n<p>Sa iyong serbisyo 24/7, pinapupurihan namin ang aming ginagawa at nagpapakita ito sa aming pagmamaneho. Pagbuo ng isang relasyon sa mga kliyente na napupunta lampas propesyonalismo.</p>","1_EN_TL.jpg","Mabilis, Mahusay at Secure","<p>Kapag kailangan mo ang iyong pag-load upang maabot mula sa Point A hanggang B, mabilis at ligtas, maaari kang umasa sa Drop and Run. Tiyak na sineseryoso namin ang pagiging kompidensyal.</p>","3-ufx_TL.jpg","Guaranteed Service With A Smile For All Your Jobs","<p>Ang lahat ng aming mga propesyonal ay nagpapahalaga sa kanilang gawain at tiyakin na binibigyan ka nila ng kanilang pinakamagaling, na iniiwan mong nasiyahan. Ginagarantiya namin na gagamitin mo nang muli ang aming mga serbisyo nang may pagtitiwala na aming inihahatid ang sinasabi namin &amp; ndash; ang pinakamahusay na! Pumindot lang ang app at iwanan ang natitira sa amin habang nakaupo ka at magrelaks.</p>","mobile-app-bg-ufx_TL.jpg","mobile-img-del-ufx_TL.png","NA PERFECTLY SYNCHRONIZED RIDE LANG PARA SA IYO","<p>Tapikin ang app, pumili ng isang driver, pumunta sa iyong patutunguhan nang walang pagtingin sa likod. Iyan ang gagawin ng aming app. Walang mga salita ang kinakailangan kapag sumakay ka sa amin dahil alam namin kung ano mismo ang gusto mo. Sumakay at i-save sa amin &amp; ndash; ang luho ay hindi makakakuha ng anumang mas mura.</p>\n\n<p><span><a href=\"about-us\"><em>KARAGDAGANG IMPORMASYON</em></a></span></p>","taxi-app-img-bg-ufx_ES_TL.jpg","taxi-app-img-ride_TL.jpg","Isang PERSONAL RIDE SA LAHAT NG TIMES","<p>Kami ay higit pa sa sistema ng taxi &amp; ndash; isang serbisyo na nasa iyong beck at tumawag sa lahat ng oras ng araw o gabi, nasaan ka man sa mundo, mga propesyonal na serbisyo na may isang ngiti &amp; nbsp; at walang kahihiyan sa oras ng pagbabayad &amp; ndash; binibigyan ka namin ng pinakamahusay na pagsakay habang tinitingnan ang iyong ginhawa at kaginhawahan</p>\n\n<p><span><a href=\"about-us\"><em>KARAGDAGANG IMPORMASYON</em></a></span></p>","Matugunan ang aming Mga Tagapagkaloob","Inaanyayahan ka ng aming pamilya sa pagmamaneho na may isang ngiti. Tingnan mo lang sila!","Active");



