er sa oras ng pagpaparehistro sa mobile application NinjaOnCall o kung hindi man.<br />\nAng &quot;User&quot; ay nangangahulugang mga tao na lumikha ng isang Account at gamitin ang Application.<br />\nAng &quot;Ikaw&quot;, &quot;Ang Iyong&quot; o &quot;Iyong Sarili&quot; ay nangangahulugang sanggunian sa User na ma-access ang Application</p>");
