\n<p><strong>This privacy policy governs your use of the software application </strong><strong>NinjaOnCall</strong><strong> (&ldquo;Application&rdquo;) for mobile devices that was created by </strong><strong>Net4Site</strong><strong>. The Application enable an </strong></p>\n\n<p><strong>What information does the Application obtain and how is it used?</strong></p>\n\n<p><strong>This section is designed to inform Users of the types of data that the app obtains and how that information is used. You&#39;ll find several types of data that are often obtained by apps, but you should provide Users with a clear, illustrative list of the most important data points obtained by your app.</strong></p>\n\n<p><strong>User Provided Information </strong></p>\n\n<p><strong>The Application obtains the information you provide when you download and register the Application. Registration with us is optional. However, please keep in mind that you may not be able to use some of the features offered by the Application unless you register with us.</strong></p>\n\n<p><strong>Alternative language if you don&#39;t allow unregistered users: &quot;Registration with us is mandatory in order to be able to use the basic features of the Application.&quot; (On the other hand, you might want to specify you don&#39;t let user register at all, but still list the information you collect).</strong></p>\n\n<p><strong>Mobile application developers should be aware that certain types of data, for example, medical records and certain types of financial information may be subject to existing privacy law, or any other current or future state, federal law, regulation, restriction, etc. Application developers creating apps that collect potentially sensitive information are encouraged to obtain counsel to ensure that their data collection policies are in line with current law in the jurisdiction(s) where the app may be used. If you collect credit card information, we strongly encourage you seek the advice of a professional to ensure PCI compliance and other specific security requirements.</strong></p>\n\n<p><strong>When you register with us and use the Application, you generally provide (a) your name, email address, age, user name, password and other registration information; (b) transaction-related information, such as when you make purchases, respond to any offers, or download or use applications from us; (c) information you provide us when you contact us for help; (d) credit card information for purchase and use of the Application, and; (e) information you enter into our system when using the Application, such as contact information and project management information.</strong></p>\n\n<p><strong>This list is not comprehensive. Adjust it according to what your app actually asks for.</strong></p>\n\n<p><strong>We may also use the information you provided us to contact your from time to time to provide you with important information, required notices and marketing promotions.</strong></p>\n\n<p><strong>Automatically Collected Information </strong></p>\n\n<p><strong>If the Application collects information from and/or for social networking platforms (e.g., pulling contact information, friends lists, login information, photos or check-ins) you should ensure that the prior consent of the user is obtained.</strong></p>\n\n<p><strong>In addition, the Application may collect certain information automatically, including, but not limited to, the type of mobile device you use, your mobile devices unique device ID, the IP address of your mobile device, your mobile operating system, the type of mobile Internet browsers you use, and information about the way you use the Application. </strong></p>\n\n<p><strong>Again, this list is not comprehensive. Adjust it according to what your app actually asks for.</strong></p>\n\n<div>\n<h4><a name=\"_wf509k2s5kjs\"></a>&nbsp;</h4>\n\n<h4><a name=\"_1kb7kbu536r3\"></a>Does the Application collect precise real time location information of the device?</h4>\n</div>\n\n<p><strong>If your app uses geolocation, check out the specific branch of this document https://www.docracy.com/6513/mobile-privacy-policy-geolocated-apps-</strong></p>\n\n<p><strong>This Application does not collect precise information about the location of your mobile device. </strong></p>\n\n<p>&nbsp;</p>\n\n<div>\n<h4><a name=\"_anqmgfoe70r1\"></a>Do third parties see and/or have access to information obtained by the Application?</h4>\n</div>\n\n<p><strong>The following language covers anonymized data that third-party analytics services might collect for you, and a few other standard cases where sharing users&#39; data is fair and justified. Generally, app developers will want to have the right to transfer information collected by the app under certain circumstances. For example, if the app developer sells the app, the developer may want that information collected by the application transferred as part of the sale. While some of the more common examples of data transfer to third parties are provided, you are encouraged to work with counsel and/or privacy professional to determine if other examples should be included in the policy.</strong></p>\n\n<p><strong>Only aggregated, anonymized data is periodically transmitted to external services to help us improve the Application and our service. We will share your information with third parties only in the ways that are described in this privacy statement.</strong></p>\n\n<p><strong>We may disclose User Provided and Automatically Collected Information:</strong></p>\n\n<ul>\n	<li><strong>as required by law, such as to comply with a subpoena, or similar legal process;</strong></li>\n	<li><strong>when we believe in good faith that disclosure is necessary to protect our rights, protect your safety or the safety of others, investigate fraud, or respond to a government request;</strong></li>\n	<li><strong>with our trusted services providers who work on our behalf, do not have an independent use of the information we disclose to them, and have agreed to adhere to the rules set forth in this privacy statement.</strong></li>\n	<li><strong>if </strong><strong>Net4Site</strong><strong> is involved in a merger, acquisition, or sale of all or a portion of its assets, you will be notified via email and/or a prominent notice on our Web site of any change in ownership or uses of this information, as well as any choices you may have regarding this information.</strong></li>\n</ul>\n\n<p><strong>If your app works with advertisers and analytics companies that collect personal data, your policy needs to have an Automatic Data Collection and Advertising section. Check out the specific branch here: https://www.docracy.com/6516/mobile-privacy-policy-ad-sponsored-apps-</strong></p>\n\n<p>&nbsp;</p>\n\n<div>\n<h4><a name=\"_v9qudofoevws\"></a>What are my opt-out rights?</h4>\n</div>\n\n<p><strong>If your app uses geolocation or taps into advertising services, check the appropriate branches linked above.</strong></p>\n\n<p><strong>You can stop all collection of information by the Application easily by uninstalling the Application. You may use the standard uninstall processes as may be available as part of your mobile device or via the mobile application marketplace or network. You can also request to opt-out via email, at </strong><strong>privacy@net4site.com</strong><strong>.</strong></p>\n\n<p>&nbsp;</p>\n\n<div>\n<h4><a name=\"_4ht0btvcvfim\"></a>Data Retention Policy, Managing Your Information</h4>\n</div>\n\n<p><strong>We will retain User Provided data for as long as you use the Application and for a reasonable time thereafter. We will retain Automatically Collected information for up to </strong><strong>24 months</strong><strong> and thereafter may store it in aggregate. If you&rsquo;d like us to delete User Provided Data that you have provided via the Application, please contact us at </strong><strong>privacy@net4site.com </strong><strong>and we will respond in a reasonable time. Please note that some or all of the User Provided Data may be required in order for the Application to function properly.</strong></p>\n\n<p>&nbsp;</p>\n\n<div>\n<h4><a name=\"_j5hbcm6u8wm0\"></a>Children</h4>\n</div>\n\n<p><strong>Your app has to comply with the Children&rsquo;s Online Privacy Protection Act (COPPA). Developers should pay particular attention to COPPA when creating apps that contain cartoon characters or other features that may cause the app to be perceived as being directed towards children under 13. Consider including language in your Terms of Service that makes users represent they are of age. Application developers creating apps that might be governed under COPPA or similar laws are encouraged to obtain counsel to ensure that their data collection policies are in line with current law in the jurisdiction(s) where the app may be used.</strong></p>\n\n<p><strong>We do not use the Application to knowingly solicit data from or market to children under the age of 13. If a parent or guardian becomes aware that his or her child has provided us with information without their consent, he or she should contact us at </strong><strong>privacy@net4site.com</strong><strong>. We will delete such information from our files within a reasonable time.</strong></p>\n\n<div>\n<h4><a name=\"_gadnoz1m429f\"></a>&nbsp;</h4>\n\n<h4><a name=\"_l9f36tro2y16\"></a>Security</h4>\n</div>\n\n<p><strong>Application developers should ensure that their security procedures are reasonable, and should provide an overview of their security procedures below.</strong></p>\n\n<p><strong>We are concerned about safeguarding the confidentiality of your information. We provide physical, electronic, and procedural safeguards to protect information we process and maintain. For example, we limit access to this information to authorized employees and contractors who need to know that information in order to operate, develop or improve our Application. Please be aware that, although we endeavor provide reasonable security for information we process and maintain, no security system can prevent all potential security breaches.</strong></p>\n\n<p>&nbsp;</p>\n\n<div>\n<h4><a name=\"_nmkdt98m29il\"></a>Changes</h4>\n</div>\n\n<p><strong>This Privacy Policy may be updated from time to time for any reason. We will notify you of any changes to our Privacy Policy by posting the new Privacy Policy </strong><strong>here</strong><strong> and </strong><strong>informing you via email or text message</strong><strong>. You are advised to consult this Privacy Policy regularly for any changes, as continued use is deemed approval of all changes. </strong></p>\n\n<p>&nbsp;</p>\n\n<div>\n<h4><a name=\"_c2sev1h3acyb\"></a>Your Consent</h4>\n</div>\n\n<p><strong>By using the Application, you are consenting to our processing of your information as set forth in this Privacy Policy now and as amended by us. &quot;Processing,&rdquo; means using cookies on a computer/hand held device or using or touching information in any way, including, but not limited to, collecting, storing, deleting, using, combining and disclosing information, all of which activities will take place in the </strong><strong>United States</strong><strong>. If you reside outside the </strong><strong>United States</strong><strong> your information will be transferred, processed and stored there under </strong><strong>United States</strong><strong> privacy standards. </strong></p>\n\n<p>&nbsp;</p>\n\n<div>\n<h4><a name=\"_goo9mtqujqcz\"></a>Contact us</h4>\n</div>\n\n<p><strong>If you have any questions regarding privacy while using the Application, or have questions about our practices, please contact us via email at </strong><strong>privacy@net4site.com</strong><strong>.</strong></p>\n</div>","Active","Privacy Policy","<p><strong>Ang patakaran sa privacy na ito ay namamahala sa iyong paggamit ng application software NinjaOnCall (&quot;Application&quot;) para sa mga mobile device na nilikha ng Net4Site. Pinapagana ng Application ang isang</strong></p>\n\n<p><strong>Anong impormasyon ang nakuha ng Application at paano ito ginagamit?</strong></p>\n\n<p><strong>Ang seksyon na ito ay dinisenyo upang ipaalam ang Mga Gumagamit ng mga uri ng data na nakuha ng app at kung paano ginagamit ang impormasyong iyon. Makakahanap ka ng maraming uri ng data na kadalasang nakuha ng apps, ngunit dapat mong bigyan ang mga Gumagamit ng isang malinaw, nakapagpapakita na listahan ng mga pinakamahalagang punto ng data na nakuha ng iyong app.</strong></p>\n\n<p><strong>User Provided Information</strong></p>\n\n<p><strong>Kinukuha ng Application ang impormasyon na iyong ibinibigay kapag nag-download ka at nagrerehistro sa Application. Ang pagpaparehistro sa amin ay opsyonal. Gayunpaman, mangyaring tandaan na maaaring hindi mo magagamit ang ilan sa mga tampok na inaalok ng Application maliban kung magrehistro ka sa amin.</strong></p>\n\n<p><strong>Ang alternatibong wika kung hindi mo pinapayagan ang mga hindi rehistradong gumagamit: &quot;Ang pagpaparehistro sa amin ay ipinag-uutos upang magamit ang mga pangunahing tampok ng Application.&quot; (Sa kabilang banda, baka gusto mong tukuyin na hindi mo pinahihintulutan ang user na magparehistro, ngunit ilista pa rin ang impormasyong iyong kinokolekta).</strong></p>\n\n<p><strong>Ang mga developer ng mobile na application ay dapat magkaroon ng kamalayan na ang ilang mga uri ng data, halimbawa, mga medikal na talaan at ilang uri ng impormasyon sa pananalapi ay maaaring napapailalim sa umiiral na batas sa pagkapribado, o anumang iba pang kasalukuyan o hinaharap na estado, pederal na batas, regulasyon, paghihigpit, atbp Mga developer ng Application Ang paglikha ng mga apps na mangolekta ng potensyal na sensitibong impormasyon ay hinihikayat na makakuha ng payo upang matiyak na ang kanilang mga patakaran sa pagkolekta ng data ay nasa linya ng kasalukuyang batas sa (mga) hurisdiksyon kung saan maaaring gamitin ang app. Kung kinokolekta mo ang impormasyon ng credit card, malakas kaming hinihikayat kang humingi ng payo ng isang propesyonal upang matiyak ang pagsunod sa PCI at iba pang partikular na mga kinakailangan sa seguridad.</strong></p>\n\n<p><strong>Kapag nag-rehistro ka sa amin at ginagamit ang Application, sa pangkalahatan ay nagbibigay sa iyo (a) iyong pangalan, email address, edad, pangalan ng user, password at iba pang impormasyon sa pagpaparehistro; (b) impormasyon na may kaugnayan sa transaksyon, tulad ng kapag gumawa ka ng mga pagbili, tumugon sa anumang mga alok, o mag-download o magamit ang mga application mula sa amin; (c) impormasyon na ibinigay mo sa amin kapag nakikipag-ugnay ka sa amin para sa tulong; (d) impormasyon ng credit card para sa pagbili at paggamit ng Application, at; (e) impormasyon na ipinasok mo sa aming system kapag ginagamit ang Application, tulad ng impormasyon ng contact at impormasyon sa pamamahala ng proyekto.</strong></p>\n\n<p><strong>Ang listahan na ito ay hindi komprehensibo. Ayusin ito ayon sa kung ano talaga ang hiniling ng iyong app.</strong></p>\n\n<p><strong>Maaari din naming gamitin ang impormasyong ibinigay mo sa amin upang makipag-ugnay sa iyong paminsan-minsan upang mabigyan ka ng mahalagang impormasyon, kinakailangang mga abiso at mga promo sa marketing.</strong></p>\n\n<p><strong>Awtomatikong Nakolektang Impormasyon</strong></p>\n\n<p><strong>Kung ang Application ay nangongolekta ng impormasyon mula sa at / o para sa mga platform ng social networking (hal., Paghawak ng impormasyon ng contact, mga listahan ng kaibigan, impormasyon sa pag-login, mga larawan o mga check-in) dapat mong matiyak na ang naunang pahintulot ng gumagamit ay nakuha.</strong><br />\n<br />\n&nbsp;</p>\n\n<p><strong>Bilang karagdagan, ang Application ay maaaring mangolekta ng ilang impormasyon awtomatikong, kabilang ang, ngunit hindi limitado sa, ang uri ng mobile device na iyong ginagamit, ang iyong mga mobile device natatanging device ID, ang IP address ng iyong mobile device, ang iyong mobile operating system, ang uri ng mobile Mga browser ng internet na ginagamit mo, at impormasyon tungkol sa paraan ng paggamit mo sa Application.</strong></p>\n\n<p><strong>Muli, ang listahang ito ay hindi komprehensibo. Ayusin ito ayon sa kung ano talaga ang hiniling ng iyong app.</strong></p>\n\n<p><br />\n<strong>Kinokolekta ba ng Application ang tumpak na real time na impormasyon sa lokasyon ng device?<br />\nKung ang iyong app ay gumagamit ng geolocation, tingnan ang tukoy na sangay ng dokumentong ito https://www.docracy.com/6513/mobile-privacy-policy-geolocated-apps-</strong></p>\n\n<p><strong>Ang Application na ito ay hindi mangolekta ng tumpak na impormasyon tungkol sa lokasyon ng iyong mobile device.</strong></p>\n\n<p><strong>Nakikita ba ng mga third party at / o may access sa impormasyon na nakuha ng Application?<br />\nSinasaklaw ng sumusunod na wika ang hindi nakikilalang data na maaaring kolektahin ng mga serbisyo ng analytics ng third-party para sa iyo, at ilang iba pang mga karaniwang kaso kung saan ang pagbabahagi ng data ng mga gumagamit ay makatarungan at makatwiran. Sa pangkalahatan, nais ng mga developer ng app na magkaroon ng karapatang maglipat ng impormasyong nakolekta ng app sa ilalim ng ilang mga pangyayari. Halimbawa, kung ang nagbebenta ng app ay nagbebenta ng app, maaaring gusto ng developer na ang impormasyong nakolekta ng application ay inilipat bilang bahagi ng pagbebenta. Habang ang ilan sa mga mas karaniwang mga halimbawa ng paglipat ng data sa mga ikatlong partido ay ipinagkaloob, hinihikayat kang gumana sa payo at / o propesyonal sa pagkapribado upang matukoy kung ang ibang mga halimbawa ay dapat isama sa patakaran.</strong></p>\n\n<p><strong>Tanging pinagsama-sama, ang hindi nakikilalang data ay pana-panahong nakukuha sa mga panlabas na serbisyo upang matulungan kaming mapabuti ang Application at aming serbisyo. Ibabahagi namin ang iyong impormasyon sa mga third party lamang sa mga paraan na inilarawan sa pahayag sa privacy na ito.</strong></p>\n\n<p><strong>Maaari naming ibunyag ang Ibinigay ng User at Awtomatikong Nakolektang Impormasyon:</strong></p>\n\n<p><strong>tulad ng iniaatas ng batas, tulad ng upang sumunod sa isang subpoena, o katulad na legal na proseso;<br />\nkapag naniniwala kami na may mabuting pananampalataya na kinakailangan ang pagsisiwalat upang maprotektahan ang aming mga karapatan, protektahan ang iyong kaligtasan o ang kaligtasan ng iba, magsiyasat sa pandaraya, o tumugon sa kahilingan ng pamahalaan;<br />\nsa aming mga pinagkakatiwalaang mga tagapagkaloob ng serbisyo na nagtatrabaho para sa amin, walang independiyenteng paggamit ng impormasyong ibinubunyag namin sa kanila, at sumang-ayon na sundin ang mga patakaran na nakalagay sa pahayag sa privacy na ito.<br />\nkung ang Net4Site ay kasangkot sa isang pagsama, pagkuha, o pagbebenta ng lahat o bahagi ng mga asset nito, aabisuhan ka sa pamamagitan ng email at / o isang kilalang abiso sa aming Web site ng anumang pagbabago sa pagmamay-ari o paggamit ng impormasyong ito, pati na rin tulad ng anumang mga pagpipilian na maaaring mayroon ka tungkol sa impormasyong ito.<br />\nKung gumagana ang iyong app sa mga advertiser at mga kumpanya ng analytics na mangolekta ng personal na data, ang iyong patakaran ay kailangang magkaroon ng isang Awtomatikong Data Collection at Advertising section. Tingnan ang partikular na branch dito: https://www.docracy.com/6516/mobile-privacy-policy-ad-sponsored-apps-</strong></p>\n\n<p><strong>Ano ang aking mga karapatan sa pag-opt out?<br />\nKung ang iyong app ay gumagamit ng geolocation o taps sa mga serbisyo sa advertising, suriin ang naaangkop na mga sanga na naka-link sa itaas.</strong></p>\n\n<p><strong>Maaari mong ihinto ang lahat ng koleksyon ng impormasyon sa pamamagitan ng Application sa pamamagitan ng pag-uninstall ng Application. Maaari mong gamitin ang karaniwang mga proseso ng pag-uninstall na magagamit bilang bahagi ng iyong mobile device o sa pamamagitan ng marketplace ng mobile application o network. Maaari ka ring humiling na mag-opt out sa pamamagitan ng email, sa privacy@net4site.com.</strong></p>\n\n<p><strong>Patakaran sa Pagpapanatili ng Data, Pamamahala ng Iyong Impormasyon<br />\nSusuriin namin ang data na ibinigay ng Gumagamit nang hangga&#39;t ginagamit mo ang Application at para sa isang makatwirang oras pagkatapos noon. Ipagpapanatili namin ang Awtomatikong Nakolekta na impormasyon hanggang sa 24 na buwan at pagkatapos ay maaaring mag-imbak ito nang pinagsama-samang. Kung nais mong tanggalin namin ang Data na ibinigay ng User na iyong ibinigay sa pamamagitan ng Application, mangyaring makipag-ugnay sa amin sa privacy@net4site.com at tutugon kami sa isang makatwirang oras. Mangyaring tandaan na ang ilan o lahat ng Data na Ibinigay ng User ay maaaring kinakailangan upang ang Application ay gumana ng maayos.</strong><br />\n<br />\n&nbsp;</p>\n\n<p><strong>Mga bata<br />\nDapat sumunod ang iyong app sa Online Protection Act ng Proteksyon sa Bata (COPPA). Ang mga developer ay dapat magbayad ng partikular na atensyon sa COPPA kapag lumilikha ng mga app na naglalaman ng mga character na cartoon o iba pang mga tampok na maaaring maging sanhi ng ang app na maunawaan bilang itinuro sa mga bata sa ilalim ng 13. Isaalang-alang ang kabilang ang wika sa iyong Mga Tuntunin ng Serbisyo na ginagawang mga gumagamit na kumakatawan sa kanilang edad. Ang mga developer ng application na lumilikha ng apps na maaaring pamamahalaan sa ilalim ng COPPA o mga katulad na batas ay hinihikayat na makakuha ng payo upang matiyak na ang kanilang mga patakaran sa pagkolekta ng data ay nasa linya ng kasalukuyang batas sa (mga) hurisdiksyon kung saan maaaring gamitin ang app.</strong></p>\n\n<p><strong>Hindi namin ginagamit ang Application upang sadyang makuha ang data mula sa o market sa mga bata sa ilalim ng edad na 13. Kung ang isang magulang o tagapag-alaga ay nakaaalam na ang kanyang anak ay nagbigay sa amin ng impormasyon nang walang pahintulot, dapat siya makipag-ugnay sa amin sa privacy @ net4site.com. Tatanggalin namin ang naturang impormasyon mula sa aming mga file sa loob ng makatwirang oras.</strong></p>\n\n<p><br />\n<strong>Seguridad<br />\nDapat tiyakin ng mga developer ng application na ang kanilang mga pamamaraan sa seguridad ay makatwiran, at dapat magbigay ng pangkalahatang ideya ng kanilang mga pamamaraan sa seguridad sa ibaba.</strong></p>\n\n<p><strong>Nababahala kami tungkol sa pagbabantay ng pagiging kompidensyal ng iyong impormasyon. Nagbibigay kami ng pisikal, elektronikong, at pamamaraan na pananggalang upang protektahan ang impormasyong aming pinoproseso at pinapanatili. Halimbawa, nililimitahan namin ang pag-access sa impormasyong ito sa mga awtorisadong empleyado at kontratista na kailangang malaman ang impormasyong iyon upang makapagpatakbo, bumuo o mapabuti ang aming Application. Mangyaring magkaroon ng kamalayan na, bagama&#39;t sinisikap naming magbigay ng makatwirang seguridad para sa impormasyon na aming pinoproseso at pinanatili, walang sistema ng seguridad na maaaring pigilan ang lahat ng mga potensyal na paglabag sa seguridad.</strong></p>\n\n<p><strong>Mga pagbabago<br />\nAng Patakaran sa Pagkapribado na ito ay maaaring ma-update paminsan-minsan sa anumang dahilan. Ipapaalam namin sa iyo ang anumang mga pagbabago sa aming Patakaran sa Pagkapribado sa pamamagitan ng pag-post ng bagong Patakaran sa Pagkapribado dito at pagpapabatid sa iyo sa pamamagitan ng email o text message. Ikaw ay pinapayuhan na kumonsulta sa Patakaran sa Privacy na ito nang regular para sa anumang mga pagbabago, tulad ng patuloy na paggamit ay itinuturing na apruba ng lahat ng mga pagbabago.</strong></p>\n\n<p><strong>Ang iyong Pahintulot<br />\nSa pamamagitan ng paggamit ng Application, sinasang-ayunan mo ang aming pagproseso ng iyong impormasyon tulad ng itinakda sa Patakaran sa Pagkapribado na ito at bilang susugan sa amin. Ang &quot;pagproseso,&quot; ay nangangahulugang paggamit ng mga cookies sa isang computer / hand held device o paggamit o paghawak ng impormasyon sa anumang paraan, kabilang ang, ngunit hindi limitado sa, pagkolekta, pag-iimbak, pagtanggal, paggamit, pagsasama at pagsisiwalat ng impormasyon, lahat ng aktibidad ay magaganap sa Estados Unidos Kung ikaw ay naninirahan sa labas ng Estados Unidos ang iyong impormasyon ay ililipat, maiproseso at naka-imbak doon sa ilalim ng mga pamantayan sa privacy ng Estados Unidos.</strong></p>\n\n<p><strong>Makipag-ugnayan sa amin<br />\nKung mayroon kang anumang mga katanungan tungkol sa privacy habang ginagamit ang Application, o may mga katanungan tungkol sa aming mga kasanayan, mangyaring makipag-ugnay sa amin sa pamamagitan ng email sa privacy@net4site.com.</strong></p>");
