  `eUserType` enum('Driver','Passenger') CHARACTER SET utf8 DEFAULT 'Passenger',
  `vMessage` varchar(2500) CHARACTER SET utf8 NOT NULL,
  PRIMARY KEY (`iRatingId`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=latin1;




